export const ApiUrl: string = "https://reqres.in/api/products";

export const FetchApi = async (params: string = "") => {
    fetch(`${ApiUrl}${params}`)
        .then(async (response) => {
            // if (response.status !== 200) {
            //     return { error: "Something went wrong: " + response.status };
            // }

            const data = await response.json();
            // data = response;
            const responseData = { ...data };
            console.log("Response data 1:   ", responseData);
            return responseData;
        })
        .catch((err) => {
            // data = {
            //     data: {
            //         errorMessage: err.message,
            //     },
            // };
        })
        .finally(() => console.log("Fetching finished"));
};
